To prevent the "Quit <application name>" item on the Apple menu from quitting the application without allowing the user to intervene (say allow them to save documents), I am adding a handler to the SWT.CLOSE event on the Display, then programatically setting the event's doit field. I'm using this code:

  display.addListener(SWT.Close, new Listener () {
    public void handleEvent (Event e) {
      CharacterBurnerApplication.logger.fine("Request to quit app...");
      e.doit = allowToQuit();
    }
  });

Observed behavior:
I can only get one cycle--of this event being fired and the event's doit field set to false--to occur. Once I have set this field doit to false, subsequent selections of the Quit (via mouse or accelerator) item do nothing. I can only quit the application by right-clicking on it in the Dock and chosing quit (which, BTW, does fire the SWT.CLOSE handler properly).

Expected behavior:
Selecting the Quit menu item on the Apple menu should fire the SWT.CLOSE handler every time.

I experience the same behaviour and might have found the cause for the problem. The commandProc(...) method of org.eclipse.swt.widgets.Display receives subsequent selection of the application menu's Quit-Item with an eventKind "OS.kEventProcessCommand". It the checks the commandId, which is "kAEQuitApplication" in this case:

if (command.commandID == OS.kAEQuitApplication) {
	if (!closing) close ();
	return OS.noErr;
}

Now the problem is the check against the boolean "closing" variable. It is a private field of the Display-class and changed in the close() method:

public void close () {
	checkDevice ();
	closing = true;
	Event event = new Event ();
	sendEvent (SWT.Close, event);
	if (event.doit) dispose ();
}

closing is set to true, regardless if the user issues a veto (by setting event.doit = false) or not. Because the close() method is responsible for sending the SWT.CLOSE event it is not called more than one time, due to the check against the boolean variable. If I'm not mistaken, the closing value should be reset to false if one of the event handlers issues a veto (event.doit = false).

Note that it will sometimes pass, but on my machine it usually fails.  Dump is: 

