As far as I can tell there is no documented way to run text search from plugins. After looking around for a long time I figure out that this works: 

 FileTextSearchScope scope = FileTextSearchScope.newSearchScope(...)
 ISearchQuery query = new FileSearchQuery(searchText, isRegEx, isCaseSensitive, scope);
 NewSearchUI.runQueryInBackground(query);

But the FileSearchQuery is discouraged access.  Should be encouraged and documented.

