Hi Paul,

Thanks for the additional test case.  I've added it to the codebase after some modifications.

Your test case, as it was, however, didn't give ECF enough of a chance :).  What was happening with your test case is that you were calling the remoteContainerOne.registerRemoteService(...) 

call *before* 
	IRemoteServiceContainerAdapter remoteContainerTwo = (IRemoteServiceContainerAdapter) clientTwo.getAdapter(IRemoteServiceContainerAdapter.class);

This call to get the IRemoteServiceContainerAdapter off of remoteContainerTwo has to be done *before* the remote registration (or the connect) as the creation of the local registry is done lazily...at the time the adapter is retrieved...and if it's done after the remote registration is complete it will have missed the message sent to it from client one.

So, the following code works:

		// Connect client one
		clientOne.connect(serverID, null);
		// Get remoteservicecontaineradapter for client one
		IRemoteServiceContainerAdapter remoteContainerOne = (IRemoteServiceContainerAdapter) clientOne.getAdapter(IRemoteServiceContainerAdapter.class);
		assertNotNull(remoteContainerOne);

		// Connect client two
		clientTwo.connect(serverID, null);

		IRemoteServiceContainerAdapter remoteContainerTwo = (IRemoteServiceContainerAdapter) clientTwo.getAdapter(IRemoteServiceContainerAdapter.class);
		assertNotNull(remoteContainerTwo);

		remoteContainerTwo.addRemoteServiceListener(new IRemoteServiceListener() {
			public void handleServiceEvent(IRemoteServiceEvent event) {
				System.out.println("handleServiceEvent(" + event + ")");
			}
		});

		// Now everything is set up for two clients

		// Now register remote service for client one
		IRemoteServiceRegistration remoteServiceRegistration = remoteContainerOne.registerRemoteService(new String[] { org.eclipse.ecf.tests.remoteservice.IConcat.class.getName() }, new IConcat() { 
			public String concat(String first, String second) {
				System.out.println("SERVICE EXEC: concat(" + first
						+ "," + second + ")");
				return first + second;
			} }, null);
		waitTime(2000);

		// Retrieve remote service reference from client one (localhost)
		IRemoteServiceReference[] refsOne = remoteContainerOne.getRemoteServiceReferences(null, org.eclipse.ecf.tests.remoteservice.IConcat.class.getName(), null);
		assertTrue(refsOne.length > 0);

		// Retrieve remote service reference for client two
		IRemoteServiceReference[] refs = remoteContainerTwo.getRemoteServiceReferences(null, org.eclipse.ecf.tests.remoteservice.IConcat.class.getName(), null);
		assertTrue(refs.length > 0);


It also works to call the clientTwo.getAdapter(IRemoteServiceContainerAdapter.class) 
*before* the clientTwo connect.  

This was a choice to lazily instantiate the adapter and local registry copy...and so it requires that the getAdapter call be made early (before either remote registration or connection).  This can be changed, but it has some advantages in that it allows the client to remain lean until the remote services functionality is actually needed (in this test case obviously it's needed right away).

