I think the following code from EclipseLazyStarter.preFindLocalClass is not adequate:
-----
		if (bundle.getState() == Bundle.STARTING) {
			// If the thread trying to load the class is the one trying to activate the bundle, then return the class 
			if (bundle.testStateChanging(Thread.currentThread()) || bundle.testStateChanging(null))
				return;

			// If it's another thread, we wait and try again. In any case the class is returned. 
			// The difference is that an exception can be logged.
			// TODO do we really need this test?  We just did it on the previous line?
			if (!bundle.testStateChanging(Thread.currentThread())) {
				Thread threadChangingState = bundle.getStateChanging();
				if (StatsManager.TRACE_BUNDLES && threadChangingState != null)
					System.out.println("Concurrent startup of bundle " + bundle.getSymbolicName() + " by " + Thread.currentThread() + " and " + threadChangingState.getName() + ". Waiting up to 5000ms for " + threadChangingState + " to finish the initialization."); //$NON-NLS-1$ //$NON-NLS-2$ //$NON-NLS-3$ //$NON-NLS-4$ //$NON-NLS-5$
-----

This code compares two threads, the bundle-start caller (getStateChanging()) and the current thread running preFindLocalClass().  But these are only two representatives of the relevant threads, not the entire set. 

In class loading for a plugin there are two types of threads: 
1) The threads running the plugin startup and calling preFindLocalClass() 
   These should proceed with class loading.
2) Every other thread calling preFindLocalClass().
   These should block until plugin startup completes.

The 3.2 preFindLocalClass() assigns only one thread to type 1: getStateChanging().  If any other thread calls preFindLocalClass() it "must be" type 2.  Except that doesn't work (see 86713) because sometimes the calling thread is of type 1. Since we don't really know, noodle around and hope for the best 5 seconds from now.

What if preFindLocalClass() could determine exactly whether the currentThread
was type 1 or 2?  Then it would return -- type 1 -- or join() the getStateChange() thread --type 2. 

Can we determine whether the currentThread is type 1?  Most of the time, yes. Type 1 threads will be:
  1a) the thread that called start(BundleContext).
  1b) a thread started from 1a
  1c) a thread running code on a call from 1a or 1b.
The vast majority of 1c cases will be calls within the Eclipse runtime, esp.
syncExec() calls to run on the UI thread.

Here is one way to mark type 1 threads: If, just before calling start(), we create a single InheritableThreadLocal variable and set it to the currentThread() (== getStateChanging() in that case),
then we have a mark for 1a and 1b. If plugin developers added three lines to the top of any run() method they define for use within plugin start up:
 if (inherited_thread_local_data.get() == null) {
   inherited_thread_local_data.set(_bundle_starter_thread);
 }
then the variable could be propagated to all type 1 threads.  Then the preFindLocalClass() could test for all type 1 threads with confidence.

Hope this helps...John.

