for (Iterator it = myDomainModel.getEClassifiers().iterator(); it.hasNext();) {
Object next = it.next();
if (next instanceof EClass) {
EClass eClass = (EClass) next;
if (!eClass.isAbstract() && !eClass.isInterface() && !eClass.getEAllContainments().isEmpty()) {
rv.add(eClass);
}
}
}
return rv;
}

